// npm i prop-types


import PropTypes from "prop-types"

function App9({ name, age, city, state, country }) {
    return (
        <div>
            <p>name:{name}</p>
            <p>age:{age}</p>
            <p>city:{city}</p>
            <p>state:{state}</p>
            <p>country:{country}</p>

        </div>
    )

}

// validating datatypes
App9.PropTypes = {
    name: PropTypes.string,
    age: PropTypes.number,
    city: PropTypes.array,
    state: PropTypes.string,
    country: PropTypes.string
}

function Proops() {
    return (
        <div>
            <App9 name="harikrishna" age="22" city="jammalmadugu" state="andhrapradesh" country="india" />

        </div>
    )
}


export default Proops;
